import './App.css'
import Map from '@mapsindoors/react-components/dist/map.es.js';
import { defineCustomElements } from '@mapsindoors/components/dist/esm/loader.js';
import { useEffect, useState } from 'react';

defineCustomElements();

function App() {

    const [venues, setVenues] = useState();
    const [selectedVenueName, setSelectedVenueName] = useState();
    const [locationDetails, setLocationDetails] = useState();

    useEffect(() => {
        window.mapsindoors.services.VenuesService.getVenues().then(v => setVenues(v));
        setSelectedVenueName('AUSTINOFFICE');
    }, []);

    const changeVenue = event => {
        setSelectedVenueName(event.target.name);
        window.mapsIndoorsInstance.setVenue(venues.find(v => v.name === event.target.value));
        window.mapsIndoorsInstance.fitVenue(venues.find(v => v.name === event.target.value));
    };

    const book = () => {
        if (confirm(`Book the room "${locationDetails.properties.name}"?`)) {
            // Override display rule of Location to indicate as booked
            const displayRule = window.mapsIndoorsInstance.getDisplayRule(locationDetails);
            displayRule.extrusionColor = '#FF0000';
            window.mapsIndoorsInstance.setDisplayRule(locationDetails.id, displayRule);
            setLocationDetails();
        }
    };

    const zoom = () => {
        const map = window.mapsIndoorsInstance.getMap();
        map.setPitch(45);
        map.setBearing(100);
        map.setZoom(20)
        map.setCenter({ lng: -97.74212109990427, lat: 30.360645908269646 })
    };

    return (<>
        {locationDetails && <dialog className="dialog" open>
            <div className="location-details">
                <button className="close" type="button" onClick={() => setLocationDetails()}>x</button>
                <h2>{locationDetails.properties.name}</h2>

                {locationDetails.properties.type.startsWith('MeetingRoom') && <div>
                    <ul className="location-details__metrics">
                        {/* These are hardcoded values just to show an example */}
                        <li>üßî 1/6</li>
                        <li>üå°Ô∏è 23&deg;C</li>
                        <li>co<sub>2</sub> 1522 PPM</li>
                    </ul>
                    <button className="book" type="button" onClick={() => book()}>Book</button>
                </div>}
            </div>
        </dialog>}

        {venues && <select value={selectedVenueName} className="venue-selector" onChange={(e) => changeVenue(e)}>
            {venues?.map(venue =>
                (<option key={venue.name} value={venue.name}>{venue.venueInfo.name}</option>)
            )}
        </select>}


        <div className="app">
            <nav className="app__nav">
                <h1>
                    <img alt="" src="data:image/png;base64," />
                    MapsIndoors Office Demo
                </h1>
                <ul>
                    <li>Home</li>
                    <li className="selected">Map</li>
                    <li>Reports</li>
                </ul>
            </nav>
            <div className="app__map">
                <Map
                    apiKey="mapspeople3d"
                    mapboxAccessToken={import.meta.env.VITE_MAPBOX_ACCESS_TOKEN}
                    onMapReady={() => zoom()}
                    onLocationClick={location => setLocationDetails(location)}
                    />
            </div>
            <div className="app__footer">Footer</div>
        </div>
    </>
    )
}

export default App
